function parseCSV(csv) {
    return csv.split("\n").map(line =>
        line.split(',').map(text => text.trim().replace(/^"|"$/g, ''))
    );
}

function populateTable(dataRows) {
    const tableBody = document.getElementById("galleryTable").getElementsByTagName("tbody")[0];
    // Clear existing table rows
    while (tableBody.firstChild) tableBody.removeChild(tableBody.firstChild);
    // Add new rows from data
    dataRows.forEach(row => {
        const tr = document.createElement("tr");
        // Assuming row format is [number, block, imageUrl, traits]
        // Create cells for number, block, and image
        for (let i = 0; i < 3; i++) {
            const td = document.createElement("td");
            if (i === 2) { // If the column is for the image
                const img = new Image(100); // Set image width for consistency
                img.src = row[i];
                td.appendChild(img);
            } else {
                td.textContent = row[i];
            }
            tr.appendChild(td);
        }
        // Concatenate all traits into a single cell
        const traitsTd = document.createElement("td");
        // Assuming all remaining elements in the row array are traits
        traitsTd.textContent = row.slice(3).join(", ");
        tr.appendChild(traitsTd);

        tableBody.appendChild(tr);
    });
}